    <style>
        #typing-text {
            width: 1080px;
            height: 85px;
            font-size: 48px;
            border: solid 0px #C9C9C9;
            color: #ffffff;
            background-color: transparent;
            text-align: center;
            font-family: Arial;
            font-weight: bold;
            padding: 5px;
            resize: none;
            outline: none;
            box-sizing: border-box;
        }
        
        .red-text {
          color: red;
          font-size: 14px;
        }

        .big-header {
          font-size: 48px;
        }
      
        html, body {
            margin: 0;
            padding: 0;
            height: 100%;
            overflow: hidden;
        }

        body {
            font-family: 'Roboto', sans-serif;
            background: linear-gradient(to right, #1e1e1e, #000000);
            color: #ffffff;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100%;
            transition: transform 0.5s ease-in-out, opacity 0.5s ease-in-out;
        }

        h1, h2, p {
            text-align: center;
            color: #ffffff;
            font-size: 32px; /* Original font size for headings */
            margin-bottom: 20px;
        }

        .container {
            background-color: #222;
            padding: 30px;
            border-radius: 20px;
            box-shadow: 0 0 20px rgba(0, 0, 0, 0.8);
            width: 400px;
            margin-top: 20px; /* Adjust the margin as needed */
        }

        .login-form {
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        label {
            margin-top: 10px;
            color: #bdc3c7;
        }

        input {
            padding: 14px;
            margin: 8px 0;
            border: 2px solid #3498db;
            border-radius: 10px;
            width: 100%;
            box-sizing: border-box;
            color: #fff;
            background-color: #111;
            transition: border-color 0.3s ease, box-shadow 0.3s ease;
        }

        input:focus {
            border-color: #3498db;
            box-shadow: 0 0 10px rgba(52, 152, 219, 0.5);
        }

        button {
            padding: 14px;
            background: linear-gradient(to right, #3498db, #2980b9);
            color: #fff;
            border: none;
            border-radius: 10px;
            cursor: pointer;
            width: 100%;
            font-weight: bold;
            font-size: 18px;
            margin-top: 4%;
        }

        /* Ensure the embedded content takes up 100% of the width and height */
        iframe {
            display: none;
            width: 100%;
            height: 100%;
        }
